window.bookSummaryJSON = "<p>Before he was “Big Texas,” he was “Zac the Snack Pack\".</p> <p>Bianca Brannen knows time - mostly - heals all wounds. Including those your once loved ones might have unintentionally given you. (Those just take longer.) </p> <p>She thinks she’s ready when a call has her walking back into her old friend’s life. Or at least, as prepared as possible to see the starting quarterback in the National Football Organization. Before the lights, the fans, and the millions, he’d been a skinny kid with a heart of gold. </p> <p>Waltzing out of Zac Travis’s life should be easy. Just as easy as he walked out of hers.</p>"; 
